import React from 'react';

const Posts = () => {
    return(
        <div>
            <h2>Posts List</h2>
            <ol>
                <li>
                    <div className="post-entry">
                        My Amazing Post Title
                        <code className="post">18 sec</code>
                    </div>
                </li>
            </ol>
        </div>
    )
}

export default Posts;
